script: |
  super -f text -I q887.spq | sort > q887.out

inputs:
  - name: q887.spq
    data: |
      SELECT DISTINCT + - col2 * + - col1 + - col1 FROM tab1 (FORMAT parquet) cor0 WHERE 62 NOT BETWEEN 31 * + - 11 * + 66 * - + col2 * - + 62 AND - - col0 * + ( - + 26 );
  - name: tab1

outputs:
  - name: q887.out
    data: |
      1330
      290
      3149
